124 :       namespace = new GlobalNamespace(compiler, root);
125 :     }
126 : 
127 :     if (inlineAliases) {
128 :       inlineAliases(namespace);
129 :     }
130 :     nameMap = namespace.getNameIndex();
131 :     globalNames = namespace.getNameForest();
132 :     checkNamespaces();
133 : 
134 :     for (Name n : globalNames) {
135 :       flattenReferencesToCollapsibleDescendantNames(n, n.getBaseName());
136 :     }
137 : 
138 :     // We collapse property definitions after collapsing property references
139 :     // because this step can alter the parse tree above property references,
140 :     // invalidating the node ancestry stored with each reference.
141 :     for (Name n : globalNames) {
142 :       collapseDeclarationOfNameAndDescendants(n, n.getBaseName());
143 :     }
